import { combineReducers } from 'redux'
import { getAllPosts, createNewPost } from './postReducer.js'
import controlModal from './modalReducer.js'

const appReducers = combineReducers({
  getAllPosts,
  createNewPost,
  controlModal
})

export default appReducers;
